DROP TABLE IF EXISTS `bom_parts`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `bom_parts` (
  `id` int NOT NULL AUTO_INCREMENT,
  `bom_id` int DEFAULT NULL,
  `part_number` varchar(255) DEFAULT NULL,
  `part_description` varchar(255) DEFAULT NULL,
  `quantity` int DEFAULT NULL,
  `price_1` decimal(10,2) DEFAULT NULL,
  `price_2` decimal(10,2) DEFAULT NULL,
  `price_3` decimal(10,2) DEFAULT NULL,
  `price_4` decimal(10,2) DEFAULT NULL,
  `price_5` decimal(10,2) DEFAULT NULL,
  `price_1_date` timestamp NULL DEFAULT NULL,
  `price_2_date` timestamp NULL DEFAULT NULL,
  `price_3_date` timestamp NULL DEFAULT NULL,
  `price_4_date` timestamp NULL DEFAULT NULL,
  `price_5_date` timestamp NULL DEFAULT NULL,
  `lead_time_1` int DEFAULT NULL,
  `lead_time_2` int DEFAULT NULL,
  `lead_time_3` int DEFAULT NULL,
  `lead_time_4` int DEFAULT NULL,
  `lead_time_5` int DEFAULT NULL,
  `lead_time_1_date` timestamp NULL DEFAULT NULL,
  `lead_time_2_date` timestamp NULL DEFAULT NULL,
  `lead_time_3_date` timestamp NULL DEFAULT NULL,
  `lead_time_4_date` timestamp NULL DEFAULT NULL,
  `lead_time_5_date` timestamp NULL DEFAULT NULL,
  `supplier` varchar(255) DEFAULT NULL,
